import { RestaurantDto } from './dto/restaurant.dto'

export class RestaurantApi {
  public static async getAll(): Promise<RestaurantDto[]> {
    const resp = await fetch('http://localhost:4000/restaurants/', {
      method: 'GET',
    })

    return await resp.json()
  }
}
